insert into metadatavalue (metadata_value_id, resource_type_id, resource_id, metadata_field_id, text_value, text_lang, place, authority, confidence) values (56,2,3,27,'Following absorption of a single photon, angles of simultaneous emission of two electrons from a He(n 1S) atom become more correlated with increasing n. We find that the strength of this correlation is due to the two-electron continuum of the electron-impact ionization of the He+(ns) ion. The strength is determined by the width of the momentum profile of the ionic ns state but not the strength of the electron correlation in the He initial state. This can explain the increasing (over He) angular correlation strength found in double photoionization of targets such as Be, Ne, and H2.',null,1,null,-1);
